import React from 'react';
import{ Link, Switch, Route } from 'react-router-dom';
import './components.css';


function MovesRoutes({props}) {

  console.log(JSON.stringify(props));

  return (
    <Switch>
      <Route path={props.location.pathname} render={(props) => <Moves {...props}/>} />
    </Switch>
  );

function Moves(props) {

  const moves = props.moves
  console.log(moves);

  MovesRoutes(props, moves={moves});

  return (
    <div>
    {
      moves.map(move => (
          <button className="button" key={move}>
              <Link className="buttonLink" to={'/mechanics/time/' + {move}}>{move}</Link>
          </button>
          ))
        }
    </div>
  )

}



}

export default Moves;
